import React from 'react';
import { BrowserRouter as Router, Route, Routes,  useLocation  } from 'react-router-dom';
import { Suspense } from 'react';
import AdminDash from '../pages/admindash/admindash';
import Adminprofile from '../pages/adminprofile/adminprofile';
import RegisterParticipant from '../pages/registration/register';
import Plan from '../pages/plan/plan';
import SubscriptionsReport from '../pages/subscriptionsreport.jsx/subscriptionreport';
import Inventory from '../pages/inventory/inventory';
import Addinventory from '../pages/inventory/addinventory/addinventory';
import ActiveMembers from '../pages/membres/activemembres';
import Coaches from '../components/coaches/coaches';
import Coachess from '../pages/coaches/coaches';
import RegisterAdminForm from '../pages/registration_admin/register';
import SalesReport from '../pages/report/report';
import LoginPage from '../pages/loginscreen/home';
import AdminLayout from '../layouts/adminlayout';


const AllRoutes = () => {
  const location = useLocation();
  const isLoginRoute = location.pathname === '/';

  return (
    <Suspense fallback={<>Loading...</>}>
      {isLoginRoute ? (
        <Routes>
          <Route path="/" element={<LoginPage />} />
        </Routes>
      ) : (
        <Routes>
          <Route path="/home" element={<AdminLayout><AdminDash /></AdminLayout>} />
          <Route path="/adminprofile" element={<AdminLayout><Adminprofile /></AdminLayout>} />
          <Route path="/registration" element={<AdminLayout><RegisterParticipant /></AdminLayout>} />
          <Route path="/plan" element={<AdminLayout><Plan /></AdminLayout>} />
          <Route path="/subscription" element={<AdminLayout><SubscriptionsReport /></AdminLayout>} />
          <Route path="/report" element={<AdminLayout><SalesReport /></AdminLayout>} />
          <Route path="/inventory" element={<AdminLayout><Inventory /></AdminLayout>} />
          <Route path="/inventory/add" element={<AdminLayout><Addinventory /></AdminLayout>} />
          <Route path="/viewmembres" element={<AdminLayout><ActiveMembers /></AdminLayout>} />
          <Route path="/coaches" element={<AdminLayout><Coachess /></AdminLayout>} />
          <Route path="/admin/register" element={<AdminLayout><RegisterAdminForm /></AdminLayout>} />
          <Route path="/user/home" element={<UserLayout><UserHome /></UserLayout>} />
          <Route path="/user/profile" element={<UserLayout><UserProfile /></UserLayout>} />
          <Route path="/user/plan" element={<UserLayout><UserPlan /></UserLayout>} />
        </Routes>
      )}
    </Suspense>
  );
};

export default AllRoutes;
